"use client"

import { useState } from "react"
import Button from "./ui/Button"
import { format, startOfWeek, addDays } from "date-fns"
import { ArrowLeft, PawPrint, Calendar, Clock } from "lucide-react"
import { Select, SelectContent, SelectItem, SelectTrigger, SelectValue } from "@/components/ui/select"

export default function AdoptionBooking() {
    const [date, setDate] = useState(null)
    const [time, setTime] = useState(null)
    const [message, setMessage] = useState("")

    // Generate next 10 days for date options
    const start = startOfWeek(new Date(), { weekStartsOn: 1 })
    const dateOptions = Array.from({ length: 10 }, (_, i) => {
        const day = addDays(start, i)
        return {
            value: day.toISOString(),
            label: format(day, "dd/MM/yyyy"),
        }
    })

    // Generate time options
    const timeOptions = Array.from({ length: 10 }, (_, i) => {
        const hour = 10 + i
        return {
            value: `${hour}:00`,
            label: `${hour}:00`,
        }
    })

    const handleConfirm = () => {
        if (!date || !time) {
            setMessage("Te rugăm să selectezi atât data, cât și ora adopției.")
            return
        }
        setMessage(`Ai programat adopția pe ${format(new Date(date), "dd/MM/yyyy")} la ${time}.`)
    }

    const handleReturn = () => {
        window.history.back()
    }

    return (
        <div className="flex flex-col min-h-screen p-4">
            {/* Header with logo and title */}
            <div className="flex items-center gap-2 mb-4">
                <PawPrint className="h-6 w-6 text-green-600" />
                <span className="text-xl font-bold">PetPal Adopții</span>
            </div>

            {/* Return button */}
            <div className="mb-8">
                <Button
                    variant="ghost"
                    className="bg-green-600 hover:bg-green-700 text-white flex items-center gap-2 px-4 py-2 rounded-md"
                    onClick={handleReturn}
                >
                    <ArrowLeft className="h-4 w-4" />
                    Înapoi
                </Button>
            </div>

            <div className="flex-1 flex flex-col items-center justify-center">
                <h1 className="text-3xl font-bold mb-8 text-center">Programare Adopție</h1>

                <div className="w-full max-w-md space-y-6">
                    {/* Date selection */}
                    <div className="space-y-2">
                        <label className="text-sm font-medium flex items-center gap-2">
                            <Calendar className="h-4 w-4 text-green-600" />
                            Selectează data:
                        </label>
                        <Select value={date} onValueChange={setDate}>
                            <SelectTrigger className="w-full">
                                <SelectValue placeholder="Alege o dată" />
                            </SelectTrigger>
                            <SelectContent>
                                {dateOptions.map((option) => (
                                    <SelectItem key={option.value} value={option.value}>
                                        {option.label}
                                    </SelectItem>
                                ))}
                            </SelectContent>
                        </Select>
                    </div>

                    {/* Time selection */}
                    <div className="space-y-2">
                        <label className="text-sm font-medium flex items-center gap-2">
                            <Clock className="h-4 w-4 text-green-600" />
                            Selectează ora:
                        </label>
                        <Select value={time} onValueChange={setTime}>
                            <SelectTrigger className="w-full">
                                <SelectValue placeholder="Alege o oră" />
                            </SelectTrigger>
                            <SelectContent>
                                {timeOptions.map((option) => (
                                    <SelectItem key={option.value} value={option.value}>
                                        {option.label}
                                    </SelectItem>
                                ))}
                            </SelectContent>
                        </Select>
                    </div>

                    {/* Confirm button */}
                    <Button className="w-full bg-green-600 hover:bg-green-700 text-white h-12 text-base" onClick={handleConfirm}>
                        Confirmă programarea
                    </Button>

                    {/* Success message */}
                    {message && (
                        <div className="mt-4 p-3 bg-green-50 border border-green-200 rounded-md text-green-700 text-center">
                            {message}
                        </div>
                    )}
                </div>
            </div>
        </div>
    )
}
